import React from 'react';
import { useEffect } from 'react';
// import { YMaps, Map, Placemark } from 'react-yandex-maps';
import { load } from '@2gis/mapgl';
/* eslint-disable */

export const Maps = () => {
  useEffect(() => {
    let map;
    load().then((mapglAPI) => {
      // container — id of the div element in your html
      map = new mapglAPI.Maps('map-container', {
        center: [56.12299, 93.323671],
        zoom: 13,
        key: 'Your API access key',
      });
    });

    // Destroy the map on unmounted
    return () => map && map.destroy();
  }, []);

  return (
    <div id='maps' className='map-wraper'>
      <div className='map-info' id='map'>
        <YMaps>
          <h1>Вы можете найти нас на Яндекс Картах</h1>
          <div className='map-window'>
            <Map
              width='100%'
              height='100%'
              defaultState={{
                center: [56.12299, 93.323671],
                zoom: 15,
              }}
            >
              {coordinates.map((coordinate) => (
                <Placemark geometry={coordinate} />
              ))}
            </Map>
          </div>
        </YMaps>
      </div>
    </div>
  );
};

export default Maps;
